I have a list of names and I want to sort them in alphabetical order. But I want to sort them in case-sensative order. For example, if I have a list of names like this:
I want to sort them like this:
I tried to use the sort() method but it sorts them like this:
How can I sort them in case-sensative order?
You can use the localeCompare method to compare strings in a case-sensitive manner. For example:
const names = ['john', 'John', 'jOHN', 'JOHN'];
names.sort((a, b) => a.localeCompare(b));
console.log(names);
// ['john', 'John', 'jOHN', 'JOHN']
You can also use the Intl.Collator constructor to create a collator object that can be used to sort strings in a case-sensitive manner. For example:
const names = ['john', 'John', 'jOHN', 'JOHN'];
const collator = new Intl.Collator(undefined, { sensitivity: 'case' });
names.sort((a, b) => collator.compare(a, b));
console.log(names);
// ['john', 'John', 'jOHN', 'JOHN']
In this example, we create a new Intl.Collator object with the sensitivity option set to 'case' , which means that the collator will compare strings in a case-sensitive manner.
